import React from 'react'
import billIcon from '../img/bill-icon.png';
const Header = () => {

    const billIconStyles = {width:'18px',height:'18px',opacity:"0.6"}

    const changeColor = ()=>{
        const btnLines = document.querySelectorAll('.togel-line')
        console.log('colored changed')
        for(var i=0;i<btnLines.length;i++){
            btnLines[i].classList.add('bg-white')
        }
    }

    const changeColorBack =()=>{
        
        const btnLines = document.querySelectorAll('.togel-line')
        setTimeout(()=>{
            
            console.log('color change back')
            for(var i=0;i<btnLines.length;i++){
                btnLines[i].classList.add('bg-silver')
            }
        },  2000)
    }

   return (
        <header className=' 
                text-white-50 
                d-flex 
                justify-content-between
                bg-dark
            ' >
                <div className='togel-btn ' onClick ={changeColorBack} onClickCapture = {changeColor}>
                    <div className='togel-line'></div>
                    <div className='togel-line'></div>
                    <div className='togel-line'></div>
                </div>

                <div className='d-flex justify-content-between col-12'>
            <ul className='
                d-flex
                justify-content-start
                align-items-center
                pt-2
                ml-4
              '>
                <li className='mr-4 list-unstyled ' >Vectors</li>
                <li className='mr-4 list-unstyled '>Photos</li>
                <li className='mr-4 list-unstyled '>PSD</li>
                <li className='mr-4 list-unstyled '>3D</li>
                <li className='mr-4 list-unstyled '>fonts</li>
                <li className='mr-4 list-unstyled '>Categories</li>
                <li className='mr-4 list-unstyled '>Collectioins</li>
                <li className='mr-4 list-unstyled '>More</li>
            </ul>

            <ul className='d-flex justify-content-start align-items-center pt-2'>
                <li className='mr-4 list-unstyled '>Sell content</li>
                <li className='mr-4 list-unstyled '>Pricing</li>
                <li className='mr-4 list-unstyled '>
                    <img src={billIcon} style={billIconStyles} />
                </li>
            </ul>
            </div>
        </header>
    )
}

export default Header;
